import React, {useState} from 'react'
import Form from 'react-bootstrap/Form';
import '../styles/style.css'
import Api from '../resources/apis';
import { Dna } from  'react-loader-spinner'

const ContactDetails: React.FC = () => {
    const [name, setName] = useState('')
    const [email, setEmail] = useState('')
    const [contact_number, setContact_number] = useState('')
    const [message, setMessage] = useState('')
    const [placeOfInterest, setPlaceOfInterest] = useState('')
    const [loading, setLoading] = useState(false)
    const [successStatus, setSuccessStatus] = useState('null')

    const sendRequest = () => {

        setLoading(true)

        // users.map((user,i)=>{
        //     console.log("comparing "+username+" and password "+password)
        //     console.log("with "+user[0]+" : "+user[1])
        //     user[0] == username ? user[1] == password ? navigate('/dashboard') : showError('Invalid credentials') : showError('Username does not exist')
        // }) 

        const params = {
            name: name, 
            email: email,
            number: contact_number,
            message: message,
            placeOfInterest: placeOfInterest
        }

        new Api().sendRequest(params).then(response=>{
            console.log("Getting data")
            console.log(response)
            console.log(response.status)

            setLoading(false)

            if(response.status == 200){
                setSuccessStatus('success')
                setName('')
                setContact_number('')
                setEmail('')
                setMessage('')
               console.log("Successfully added request")
            }

        }).catch(error => {
            console.log("Error returned is ... ")
            console.log(error)
        })
    }

    const inputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
		console.log(e.target.value)

		console.log(e.target.getAttribute('name'))

		switch(e.target.getAttribute('name')){
			case 'name':
				setName(e.target.value)
				break;
			case 'email':
				setEmail(e.target.value)
				break;
            case "contact_number":
                setContact_number(e.target.value)
                break;
            case "message":
                setMessage(e.target.value)
                break;
			default:
				return null;
		}

        // email != '' ? setShowError(false) : mobileNumber != '' ? setShowError(false) : setShowError(true)
    }

    const selectInputChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
		console.log(e.target.value)

		switch(e.target.getAttribute('name')){
			case "place_of_interest":
				setPlaceOfInterest(e.target.value)
				break;
			default:
				return null
		}

		console.log(e.target.getAttribute('name'))
    }

    return <section className="ftco-section">
        <div className="container">
            <div className="row justify-content-center">
                <div className="col-md-6 text-center mb-5">
                    <h2 className="heading-section">Contact Us</h2>
                </div>
        </div>
        <div className="row justify-content-center">
            <div className="col-md-12">
                <div className="wrapper">
                    <div className="row mb-5">
                        <div className="col-md-3">
                            <div className="dbox w-100 text-center">
                        <div className="icon d-flex align-items-center justify-content-center">
                            <span className="fa fa-map-marker"></span>
                        </div>
                        <div className="text">
                        <p><span>Address:</span> Tanzania</p>
                      </div>
                  </div>
                        </div>
                        <div className="col-md-3">
                            <div className="dbox w-100 text-center">
                        <div className="icon d-flex align-items-center justify-content-center">
                            <span className="fa fa-phone"></span>
                        </div>
                        <div className="text">
                        <p><span>Phone:</span> <a href="tel://+25578028485">+25578028485</a></p>
                      </div>
                  </div>
                        </div>
                        <div className="col-md-3">
                            <div className="dbox w-100 text-center">
                        <div className="icon d-flex align-items-center justify-content-center">
                            <span className="fa fa-paper-plane"></span>
                        </div>
                        <div className="text">
                        <p><span>Email:</span> <a href="mailto:bekabakari900@gmail.com">bekabakari900@gmail.com</a></p>
                      </div>
                  </div>
                        </div>
                        <div className="col-md-3">
                            <div className="dbox w-100 text-center">
                        <div className="icon d-flex align-items-center justify-content-center">
                            <span className="fa fa-globe"></span>
                        </div>
                        <div className="text">
                        <p><span>Website</span> <a href="#">yoursite.com</a></p>
                      </div>
                  </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</section>
}

export default ContactDetails
